features.script:
let cube = feature;
let cr = 0;
let flag = 1;
let initialPosition = new Vector3(-0.25,6,0.35) ;
let animatedPosition = new Vector3(-0.25,6.5,0.35);
let an1 = cube.createAnimation("position");
let an2 = cube.createAnimation("position");
let an3 = cube.createAnimation("rotation");
cube.rotation.y = 0;
cube.position.set(-0.25,6,0.35);

an1.setKeys([{
    frame: 1350,
    value:  cube.position.add(new Vector3(0,1,0)) 
}])

an2.setKeys([{
    frame: 1350,
    value:  cube.position.add(new Vector3(0,0,0)) 
}])

an3.setKeys([{
    frame: 2700,
    value:  cube.rotation.add(new Vector3(0,Math.PI*2,0))
  }])

cube.startAnimations([an1,an3]);
setInterval(function (){
  if(cube.rotation.y >= Math.PI*2){
    cube.rotation.y = 0;
  }
  if(flag == 1){
    cube.position.set(-0.25,7,0.35);  
    cube.startAnimations([an2,an3]);
    flag = 2;  
  }
  else{
    cube.position.set(-0.25,6,0.35);  
    cube.startAnimations([an1,an3]);
    flag = 1;  
  }
},90000)
